import React, { useEffect, useState } from 'react';
import { SiWhatsapp } from "react-icons/si";
import { useParams } from 'react-router-dom';
import api from '../services/api';

import '../styles/components/list.css';

interface Orphanage {
    id: number;
    name: string;
    description: string;
     index: 8;
}
function Profile(){
    const [orphanages, setOrphanages] = useState<Orphanage[]>();

    // execute a função quando a variavel no [] tiver alterado
    useEffect(() => {
        api.get('orphanages').then(response => {
            setOrphanages(response.data);
        })
    }, []);


      if (!orphanages) {
        return <p>Carregando...</p>
      }

      

     
  orphanages.map(orphanage =>{
    return(
       
        <article className="list">

        <header>
            <img src="https://avatars0.githubusercontent.com/u/49418565?s=460&u=caa6add820c3e5842ba889673008612e15261857&v=4" alt="Juan Andrade"/>
             <div className="">
                 <strong>
                 {orphanages.map((orphanage, index) =>{
                                 return (
                                       <h1 
                                       key={orphanage.id}
                                       className="list"
                                       >{[orphanage.name]}
                                       key={orphanage.id}</h1>

          
                                    );
                                  })}

                     

                      <span>Html </span>
                     </strong>
             </div>
        </header>
             <p>Designer grafico
                 <br/> <br/>
                {/* {orphanages.map(orphanage => {
                    <p
                    key={orphanage.id}>
                        {orphanage.description}
                        </p>
                })} */}
             </p>

             <footer>
                 <p>Preço por Hora
                     <strong>R$ 2,50</strong>
                 </p>
                 <button type="button">
                      <SiWhatsapp />
                     <p> Entrar em contado </p>
                 </button>
             </footer>
             <div className="space">
                 __________________________________________________________________________
             </div>
             
    </article>
    );
})

}

export default Profile;
